#!/usr/bin/env python3

from html.parser import HTMLParser
import json

class City:
  def __init__(self,name,lat,lng):
    self.name = name
    self.lat = lat
    self.lng = lng
    self.url = ''
  
  def __str__(self):
    return "%s: (%s,%s)" % (self.name,self.lat,self.lng)

def is_number(s):
    try:
      float(s)
      return True
    except ValueError:
      return False


def parseCountry(citiesHTML,citiesCSV,country):
  # Process cities from seatemperature.info
  urls = []
  names = []

  class SeaTemperatureHTMLParser(HTMLParser):
    base_url='https://seatemperature.info'
    def handle_starttag(self, tag, attrs):
      if tag == 'a': urls.append(SeaTemperatureHTMLParser.base_url + attrs[0][1])
    def handle_data(self, data):
      if data.strip(): names.append(data)

  parser = SeaTemperatureHTMLParser()
  parser.feed(citiesHTML)

  # Process cities from Canada Cities CSV
  csv_cities = []
  for row in open(citiesCSV):
    row = row.strip()
    if not row: continue
    row = row.split(',')
    for i in range(len(row)): row[i] = row[i][1:-1]
    if row[0] == 'city': continue
    if country == 'canada': csv_cities.append(City(row[1],row[4],row[5]))
    if country == 'us': csv_cities.append(City(row[1],row[6],row[7]))

  for i in range(len(urls)):
    name = names[i]
    url = urls[i]
    found = False
    for city in csv_cities:
      if name == city.name:
        found = city
        found.url = urls[i]
    if found:
      print(json.dumps({
        "name": found.name,
        "lat": found.lat,
        "lng": found.lng,
        "url": found.url
      }),",")

